import Header from "./components/header/Header";
import About from "./components/about/About";
import Lifestyle from "./components/lifestyle/Lifestyle";
import Galery from "./components/galery/Galery";


function App() {
  return (
    <div className="App">
           <Header />
          <About />
        <Lifestyle />
          <Galery />
    </div>
  );
}
export default App;
